Tháng 9/2002, tiền thân của Công ty cổ phần Nhựa và Môi trường Xanh An Phát là Công ty TNHH Anh Hai Duy được thành lập do hai thành viên góp vốn với số vốn điều lệ là 500 triệu đồng;
Năm 2006, Hội đồng thành viên của Công ty TNHH Anh Hai Duy thống nhất phương án chuyển đổi Công ty thành Công ty Cổ phần Nhựa và Bao bì An Phát;
Tháng 3/2007: Công ty Cổ Phần Nhựa và Bao bì An Phát được thành lập với vốn điều lệ ban đầu là 30 tỷ theo Giấy phép đăng ký kinh doanh lần đầu được sở Kế hoạch đầu tư Tỉnh Hải Dương cấp ngày 09/03/2007;
Ngày 06/04/2007, Công ty quyết định tăng vốn điều lệ lên 60 tỷ đồng. Phần vốn góp thêm 30 tỷ được phát hành cho các cổ đông cá nhân mới. Ngày 13/12/2007, Công ty quyết định tăng vốn điều lệ lên 66 tỷ đồng. Phần vốn góp thêm 6 tỷ được phát hành cho Beira Limited, nâng tổng số cổ phần của Beira Limited trong Công ty lên 800.000 cổ phần;
Tháng 11/2009: Công ty đổi tên thành Công ty Cổ phần Nhựa và Môi trường xanh An Phát;
Ngày 17/04/2010, Đại hội đồng cổ đông của Công ty quyết định tăng vốn điều lệ lên 99 tỷ đồng thông qua việc phát hành cho cổ đông hiện hữu với giá 37.000 đồng/cổ phiếu. Việc phát hành được hoàn tất vào ngày 15/05/2010;
Tháng 07/2010 Công ty chính thức niêm yết cổ phiếu tại Sở giao dịch chứng khoán Hà Nội, mã chứng khoán là AAA;
Năm 2014 Công ty thực hiện thành công việc tăng vốn điều lệ từ 198 tỷ đồng lên 396 tỷ đồng thông qua phát hành cho cổ đông hiện hữu với tỷ lệ 1:1;
Năm 2015 An Phát hoàn tất đợt phát hành cổ phiếu trả cổ tức năm 2014, tăng vốn điều lệ lên 494.999.880.000 đồng;
Tháng 05/2016 Vốn điều lệ của Công ty tăng từ 494 tỷ đồng lên 518 tỷ đồng thông qua việc phát hành cổ phiếu cho cán bộ công nhân viên.
Tháng 11/2016 Chuyển niêm yết cổ phiếu AAA từ Sở Giao dịch Chứg khoán Hà Nội (HNX) sang Sở Giao dịch Chứng khoán TP. HCM (HOSE).
Tháng 12/2016 Phát hành 5.065.000 cổ phiếu theo đề nghị thực hiện chứng quyền đợt 1 của Nhà đầu tư tăng vốn điều lệ lên 569.649.880.000 đồng.
Năm 2017, VĐL nâng lên 835.999.880.000 đồng.

Sản xuất các sản phẩm nhựa (PP, PE);
In và các dịch vụ in quảng cáo trên bao bì;
Xây dựng công trình kỹ thuật dân dụng khác;
Đại lý mua, bán, ký gửi hàng hóa;
Thu gom rác thải không độc hại;
Xử lý và tiêu hủy rác thải không độc hại;
Xử lý ô nhiễm và hoạt động quản lý chất thải khác;
Sản xuất máy móc, thiết bị phục vụ ngành nhựa;
Mua bán hàng may mặc;
Mua bán máy móc, thiết bị và phụ tùng thay thế, chuyển giao công nghệ ngành nhựa;
Lắp đặt hệ thống xây dựng khác;
Mua bán vật tư, nguyên liệu sản phẩm nhựa, bao nhì nhựa các loại;
Ủy thác thương mại.
